@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("wave.google.com") {

/*Fonts*/
p {font-family: corbel}
div, a {font-family: corbel !important}

/*Darken And Grey Section Headers*/
.IAB, .KAB, .CAB {background-image: url("data:image/png;base64,") !important;}
.GBB .EAB {background-image: url("data:image/png;base64,") !important;}
.KAB {background-color: RGB(30,30,30) !important; border-left-color: #333 !important}
.DAB {background-image: url("data:image/png;base64,") !important;}

/*Make light blue areas greyscale*/
.CW, .conv-head, .JMB, .OMB, div.foot, .HV {background-color: #DBDBDB !important}
.OMB, .JMB, div.foot {border-left-color: #DBDBDB !important}
.EBB .FAB {background-image: url("data:image/png;base64,") !important;}
.EBB .HAB {background-image: url("data:image/png;base64,") !important;}
.EBB .GAB {background-image: url("data:image/png;base64,") !important;}

/*Fixes Pings*/
.wd-focus .JAB .IAB {background-image: none !important; background-color: transparent !important;}
.DBB .KAB, .DBB .IAB {border-left-color: #333 !important; border-right-color: #333 !important; background-color: transparent !important; background-image: none !important; color: #FFF !important;}
.DBB .NAB {background-image: url("data:image/png;base64,") !important;}
.DBB .P4 {background-image: url("data:image/png;base64,") !important;}
.DBB .FS {background-image: url("data:image/png;base64,") !important;}
.DBB .KS {background-image: url("data:image/png;base64,") !important;}
.DBB .HS {background-image: url("data:image/png;base64,") !important;}
.DBB .JAB .FAB {background-color: #202020 !important; border-bottom-color: #202020 !important;}
.DBB .EAB, .FBB .EAB {background-image: url("data:image/png;base64,") !important;}
.FBB .FAB {background-image: url("data:image/png;base64,") !important;}
.FBB .HAB {background-image: url("data:image/png;base64,") !important;}
.FBB .GAB {background-image: url("data:image/png;base64,") !important;}

/*{background-image: none !important;}*/
}
